contracts/Try01/t02.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract ttt {
    struct User{
        string name;
        // uint256 name;
        address addr;
    }

    User public u00;
    User public u01;

    constructor(address _owner, string memory _name, string memory _name2){
        User storage u1 = u00;
        User storage u2 = u01;
        u1.name = _name;
        u1.addr = _owner;
        u2.name = _name2;
        u2.addr = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
    }


}

